import React from "react";
import { card } from "../../interfaces";

interface props {
    card: card
}
const  Card: React.FC<props> = ({card}) => {
    const classes = "card " + card.className;

    return (
        <div className={classes}>
            {children}
        </div>
    );
}

export default Card;
